import React from 'react';
import RoomCard from './RoomCard';

// Import the Link component from react-router-dom for navigation
import { Link } from 'react-router-dom';

function ListingsPage() {
  const rooms = [
    {
      id: 1,
      name: "Deluxe Room",
      description: "A luxurious room with a king-size bed and stunning views.",
      price: 150,
      image: "room1.jpg",
    },
    // Add more room objects here
  ];

  return (
    <div>
      {/* Create the navbar container */}
      <nav className="navbar">
        {/* Add the logo (optional) */}
        <Link to="/" className="logo">Your Company Logo</Link>
        {/* Navigation links */}
        <ul className="nav-links">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li className="active">  {/* Mark Listings as active */}
            <Link to="/listings">Listings</Link>
          </li>
          {/* Add more navigation links here */}
        </ul>
      </nav>

      <h1>Our Listings</h1>
      <div className="room-list">
        {rooms.map((room) => (
          <RoomCard key={room.id} room={room} />
        ))}
      </div>
    </div>
  );
}

export default ListingsPage;
